    "Contamination and potential impacts to monk seals",nt"tracking_summary":
    {ntt"total": 14,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:41:56.047163",nt"name": "contamination-and-potential-impacts-to-monk-seals",nt"isopen":
    false,nt"url": null,nt"notes": "There are six main Hawaiian monk seal breeding
    colonies (French Frigate Shoals, Kure Atoll, Laysan Island, Lisianski Island, Pearl
    and Hermes Reef and Midway Atoll) in the Northwestern Hawaiian Islands (NWHI). Most
    animals show a high degree of fidelity to their birth colony even though land observations
    show that some individuals move between atolls or islands. Personnel from the NOAA
    National Marine Fisheries Serviceu2019s Pacific Islands Fisheries Science Center
    collected whole blood and biopsy blubber samples from free-ranging Hawaiian monk
    seals at four Northwestern Hawaiian Islands reproductive colonies (Laysan Island,
    Midway Atoll, Pearl and Hermes Reef and French Frigate Shoals) from 1998 2002. Whole
    blood and a subset of biopsy blubber samples of Hawaiian monk seals were analyzed
    for selected organochlorine s by a high-performance liquid chromatography/photodiode
    array (HPLC/PDA) method and for lipid classes and percent lipid by thin-layer chromatography
    with flame ionization detection (TLC/FID).Although the concentrations of PCBs and
    PCB TEQs measured blubber and blood of a small number of monk seals were above threshold
    levels associated with immune dysfunction in various species of mammals, the findings
    of the current study suggest that levels of these contaminants in monk seals are
    not elevated compared to other populations of pinnipeds from the eastern North Pacific.",nt"license_title":
